    public List<String> searchMolecules(String query) {
        List<String> results = new ArrayList<>();
        String q = query.toLowerCase();

        for (Map.Entry<String, Map.Entry<String, String>> entry : m.entrySet()) {
            String formula = entry.getKey();
            String nameStr = entry.getValue().getKey();

            if (formula.toLowerCase().contains(q) || nameStr.toLowerCase().contains(q)) {
                results.add(formula + " — " + nameStr + " — " + entry.getValue().getValue());
            }
        }

        return results;
    }
    public <V> SortedMap<String, V> filterPrefix(SortedMap<String, V> baseMap, String prefix) {
        if (prefix.length() > 0) {
            char nextLetter = (char) (prefix.charAt(prefix.length() - 1) + 1);
            String end = prefix.substring(0, prefix.length() - 1) + nextLetter;
            return baseMap.subMap(prefix, end);
        }
        return baseMap;
    }


    SearchResultsContainer searchResultsContainer;

   public SearchResultsContainer partialMatches(String prefix) {
        SortedMap<String, Map.Entry<String, String>> s = filterPrefix(m, prefix);
        ArrayList<String> names = new ArrayList<>();
        ArrayList<String> masses = new ArrayList<>();
        ArrayList<String> formulas = new ArrayList<>();

        for (Map.Entry<String, Map.Entry<String, String>> entry : filterPrefix(m, prefix).entrySet()) {
            String nameStr = entry.getValue().getKey();
            String[] nameParts = nameStr.split(";");
            String firstThree = String.join("; ", Arrays.copyOfRange(nameParts, 0, Math.min(3, nameParts.length)));

            names.add(firstThree);
            formulas.add(entry.getKey());
            masses.add(entry.getValue().getValue());
        }
        return new SearchResultsContainer(names, formulas, masses);
    }


